import React from 'react'
import "./Panel.css";
import key from "../../Image/key.jpg";
import call from "../../Image/call.png";
import chat from "../../Image/chat.png";
import profile from "../../Image/profile.png";


const Panel = () => {
    return ( 
        <div className="container">
            <div className="row justify-content-center">
                <div className="col-lg-10 panel">
                    <div className="row">
                        <div className="col-lg">
                            <img src={key} alt="" width="100"/>
                            <p>Login <a href="###" className="btn btn-outline-primary">kit</a> </p>
                        </div>
                        <div className="col-lg">
                            <img src={call} alt="" width="75"/>
                            <p>Call <a href="###" className="btn btn-outline-primary">kit</a> </p>
                        </div>
                        <div className="col-lg">
                            <img src={chat} alt="" width="75"/>
                            <p>Chatt <a href="###" className="btn btn-outline-primary">kit</a> </p>
                        </div>
                        <div className="col-lg">
                            <img src={profile} alt="" width="75"/>
                            <p>Update <a href="###" className="btn btn-outline-primary">kit</a> </p>
                        </div>
                        <p>asasd</p>

                    </div>
                </div>
            </div>
        </div>
     );
}

export default Panel;
